import java.sql.Timestamp;
import java.text.SimpleDateFormat;

sdf = new SimpleDateFormat("yyyy-MM-dd'T'HH:mm:ss")
sdf.setTimeZone(TimeZone.getTimeZone("UTC"));
sdf.format(new Date()) + 'Z'

import java.util.concurrent.*

def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)

if (context.expand('${#Project#PModeProfile}') == 'LIGHT' ) {
  initialDelay = context.expand('${#Project#PullRequestInitialDelay}').toInteger()
  sleep(initialDelay)
  testRunner.runTestStepByName("ebMS3 - pull")

  numberOfTrials = context.expand('${#Project#PullRequestNumberOfRetries}').toInteger()
  errorCode = context.expand('${#Project#PullRequestErrorCode}')
  retryDelay = context.expand('${#Project#PullRequestRetryDelay}').toInteger()
  for( i in 1..numberOfTrials ) {
    handler=groovyUtils.getXmlHolder("ebMS3 - pull#Response")    
    result = handler.getDomNode("//ebms:Error[@errorCode='${errorCode}']") != null

    if(result) {      
      sleep(retryDelay)
      testRunner.runTestStepByName("ebMS3 - pull")
    }
    else {
      log.info("ebMS3 - pull successfull")
      testRunner.gotoStepByName("End Test (mock step)")
      return
    }
  }

  testRunner.fail("After ${numberOfTrials} trials ebMS3 - pull still have a node //ebms:Error[@errorCode='${errorCode}']")
  log.error("fail of ebMS3 - pull error")
} else {
   testRunner.gotoStepByName( "End Test (mock step)")
}

def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
handler=groovyUtils.getXmlHolder("RenderTemplate#Response") productOwner = context.expand('${#Project#ProductOwner}') productName = context.expand('${#Project#ProductName}') productVersion = context.expand('${#Project#ProductVersion}')
productOwner = productOwner.replaceAll(' ', '-').toLowerCase() productName = productName.replaceAll(' ', '-').toLowerCase() productVersion = productVersion.replaceAll(' ', '-').toLowerCase()
handler.setNodeValue("//ebms:MessageProperties/ebms:Property[@name='ProductId']", productOwner + "_" + productName + "_" + productVersion) handler.updateProperty()
return handler.getXml()

